import React,{useState} from "react";
import Card from "../Ui/Card.js";
import "./NewExpense.css";
import ExpenseItem from "./ExpenseItem";
import ExpensesFilter from "./ExpenseFilter.js";
function NewExpense(props) {
  const [selectYear,changeYear]=useState('2020');
  function getData(value){
    changeYear(value);
    console.log(value);
    // return selectYear;
  }

  return (
    <Card className="expenses">
      {console.log("year in new expense",selectYear)}
      <ExpensesFilter defaultYear={selectYear} takeData={getData}/>
     <ExpenseItem
        name={props.data[0].title}
        date={props.data[0].date}
        amount={props.data[0].amount}
      ></ExpenseItem>
      <ExpenseItem
        name={props.data[1].title}
        date={props.data[1].date}
        amount={props.data[1].amount}
      ></ExpenseItem>
      <ExpenseItem
        name={props.data[2].title}
        date={props.data[2].date}
        amount={props.data[2].amount}
      ></ExpenseItem>
      <ExpenseItem
        name={props.data[3].title}
        date={props.data[3].date}
        amount={props.data[3].amount}
      ></ExpenseItem>
    </Card>
  );
}
export default NewExpense;
